import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Input, Button, Label, Row, Col } from 'antd';
class Person extends Component {
    constructor() {
        super()
        this.state = {}
    }
    Search = (e) => {
        console.log(e.key)
        if (e.key === "Enter") {
            console.log(e)
        }
    }
    render() {
        return (
            <Row gutter={16}>
                <Col md={{ span: 3 }}>
                    ค้นหาผู้ป่วย:
                </Col>
                <Col md={{ span: 4 }}>
                    <Input placeholder={"HN"} id="hn" onKeyPress={(e) => this.Search(e)} />
                </Col>

            </Row>

        )
    }
}

export default connect()(Person);
